('2019-06-12', '08:20:00', '2019/06/10/000080', 'pemasangan infus di kaki kiri dengan pemberian terapi phenitoin 150 mg yang dicampur dengan NaCl 0,9% sebanyak 10 cc dengan drip 30 menit dan dilaksanakan setiap 12 jam', 'infeksi akibat pemasangan infus', '1. melaksanakan peningkatan kepatuhan hand hygene\n2. melaporkan ke DPJP pengoplosan banyaknya NaCl\n3. melakukan tindakan invasif lebih hati-hati\n4. melakukan tindakan invasif sesuai SPO', '1. peningkatan kepatuhan hand hygene\n2. kompres NaCl 0,9% di daerah Infeksi\n3. infus di aff', '2019-06-10', '2019-06-12', 'Ns. Mianna Sibuea, S.Kep.', 'IYA', 'TIDAK', NULL),
