('2019-07-10', '10:00:00', '2019/07/10/000215', 'ketidaklengkapan penulisan rekammedis (Catatan terintegrasi) dalam pelaporan dengan metode SBAR kepada DPJP.', 'komunikasi tidak efektif', 'semua petugas pemberi pelayanan kesehatan harus mengikuti pelatihan atau inhouse trainning komunikasi efektif', 'meningkatkan komunikasi efektif  antar petugas pemberi pelayanan yang dilakukan dengan akurat, lengkap, jelas dan dapat dipahami baik secara verbal dan tulisan.', '2019-07-15', '2019-07-15', 'Evin Lianty', 'IYA', 'TIDAK', NULL),
