('2023-11-15', '10:00:51', '2023/11/09/000240', 'Infeksi paru-paru (pneumonia terkait ventilator) yang berkembang karena terintubasi.', '- Infeksi paru-paru atau sistemik dapat menyebabkan perburukan kondisi pasien dan mempengaruhi hasil rontgen.\n\n- Kondisi ini sering terjadi pada pasien yang terintubasi dan bisa menyebabkan perburukan kondisi pernapasan serta perubahan pada hasil rontgen.\n\n- Penyakit Penyerta Lainnya: Pasien memiliki penyakit diabetes, gangguan sistemik lainnya yang mempengaruhi respons tubuh terhadap infeksi atau trauma', '- Periksa ulang posisi tabung endotrakeal untuk memastikan bahwa itu ditempatkan dengan benar.\n- Pastikan ventilasi mekanis (jika digunakan) diatur sesuai dengan kebutuhan pasien.\n- Perhatikan tanda-tanda komplikasi terkait dengan intubasi seperti aspirasi, dislokasi tabung, atau trauma.\n- Periksa kembali hasil rontgen untuk memastikan apakah ada faktor yang mendasarinya seperti infeksi, edema paru, atau penyakit paru obstruktif kronis (PPOK).\n- Konsultasikan dengan dokter spesialis paru atau intensivis untuk evaluasi lebih lanjut.\n- Sesuaikan perawatan medis pasien berdasarkan temuan dari evaluasi lanjutan tersebut.\n- Lakukan monitoring yang ketat terhadap respons pasien terhadap perawatan yang diberikan.', '- Periksa ulang posisi tabung endotrakeal untuk memastikan bahwa itu ditempatkan dengan benar.\n- Pastikan ventilasi mekanis (jika digunakan) diatur sesuai dengan kebutuhan pasien.\nMemastikan bahwa ventilator diatur dengan benar untuk memenuhi kebutuhan ventilasi pasien terintubasi, termasuk tekanan udara yang sesuai, laju respirasi, dan pengaturan lainnya yang sesuai.\n- Perhatikan tanda-tanda komplikasi terkait dengan intubasi seperti aspirasi, dislokasi tabung, atau trauma.\nMengamati pasien secara cermat untuk tanda-tanda komplikasi seperti kesulitan bernapas, desaturasi oksigen, peningkatan tekanan darah, atau penurunan saturasi oksigen yang bisa mengindikasikan masalah terkait intubasi.\n- Periksa kembali hasil rontgen untuk memastikan apakah ada faktor yang mendasarinya seperti infeksi, edema paru, atau penyakit paru obstruktif kronis (PPOK).\nMengulang pemeriksaan rontgen dada untuk mengevaluasi apakah ada perubahan atau komplikasi yang mendasarinya seperti pneumonia, edema paru, atau penyakit paru obstruktif kronis.\n- Konsultasikan dengan dokter spesialis paru atau intensivis untuk evaluasi lebih lanjut.\nMelibatkan konsultasi dengan dokter spesialis paru atau intensivis untuk mendapatkan tinjauan lebih lanjut mengenai manajemen pasien dan evaluasi klinis yang lebih mendalam.\n- Sesuaikan perawatan medis pasien berdasarkan temuan dari evaluasi lanjutan tersebut.\nMenyesuaikan perawatan medis dan intervensi berdasarkan temuan dari evaluasi lanjutan, misalnya penyesuaian pengaturan ventilator, pemberian antibiotik untuk infeksi, atau terapi tambahan sesuai kebutuhan.\n- Lakukan monitoring yang ketat terhadap respons pasien terhadap perawatan yang diberikan.\nMelakukan pemantauan yang ketat terhadap respons pasien terhadap perawatan yang diberikan, termasuk monitoring tanda vital, fungsi pernapasan, dan respons terhadap terapi yang diberikan.', '2024-04-03', '2024-04-03', 'Dwi Purnomo', 'IYA', 'TIDAK', 'HIJAU'),
('2024-02-12', '04:00:00', '2024/02/11/000055', 'Kegagalan dalam proses verifikasi identitas pasien : Zr. Wiwi lupa untuk memeriksa kembali label nama pasien sebelum menempelkannya pada sampel TCM. Hal ini menyebabkan kesalahan identifikasi pasien dan sampel TCM yang seharusnya milik pasien Tn. M justru dicatat sebagai milik pasien lain.', 'Kesibukan dan tekanan kerja yang tinggi : Zr. Wiwi harus merawat dua pasien sekaligus, yaitu Tn. M dan Tn. S, di tengah-tengah jadwal yang padat. Kesibukan ini mungkin menyebabkan Zr. Wiwi menjadi kurang fokus dan akhirnya lupa untuk melakukan verifikasi ulang terhadap label pasien sebelum menempelkannya pada sampel TCM.', '1. Sistem verifikasi identitas pasien harus menjadi prioritas utama dalam setiap langkah perawatan. Ini termasuk verifikasi nama, tanggal lahir, nomor identifikasi unik, dan informasi lainnya sebelum melakukan tindakan medis atau pengambilan sampel.\n\n2. Semua staf, termasuk perawat seperti Zr. Wiwi, harus secara teratur dilatih tentang prosedur yang benar dalam merawat pasien dan penanganan sampel. Ini termasuk penerapan praktik terbaik dalam identifikasi pasien dan pengecekan ulang sebelum melanjutkan ke tahap berikutnya.\n\n3. Komunikasi yang efektif antara dokter, perawat, dan petugas laboratorium sangat penting untuk menghindari kebingungan atau kesalahan dalam penanganan pasien dan sampel. Sistem komunikasi yang jelas dan efisien harus diterapkan di seluruh fasilitas kesehatan.\n\n4.  Manajemen waktu yang baik dapat membantu mengurangi kesalahan karena kelebihan beban kerja. Perencanaan jadwal dengan baik, delegasi tugas dengan tepat, dan mengantisipasi situasi darurat atau penundaan dapat membantu mengurangi tekanan dan meningkatkan konsentrasi staf medis.\n\n5.  Penggunaan teknologi seperti barcode atau identifikasi biometrik dapat membantu meningkatkan akurasi dalam identifikasi pasien. Sistem ini dapat membantu mengurangi kesalahan manusia dan meningkatkan keamanan pasien secara keseluruhan.', 'Implementasikan prosedur yang ketat untuk verifikasi identitas pasien: Hal ini sangat penting untuk mencegah kesalahan identifikasi pasien seperti yang terjadi dalam kasus ini. Proses verifikasi identitas pasien harus menjadi kebiasaan yang ketat sebelum melakukan tindakan medis atau pengambilan sampel.', '2024-04-02', '2024-04-02', 'Dwi Purnomo', 'IYA', 'TIDAK', 'HIJAU'),
('2024-03-27', '06:00:00', '2024/03/24/000033', 'Pasien Deman tgl 27  Maret 2024 jam 06, Suhu 38,2  pada catatan EWS ,  Advis dpjp dapat paracetamol syr 500 mg K/P,\npada daftar obat FTO  , tidak ada catatan pemberian paracetamol,', 'Pasien 11 orang , perawat jaga 1 orang dan sekaligus bertugas sebagai MOD\nSaat bersamaan pada ps anak yg lain ada ngt tercabut, infus bengkak , dalam hal ini membuat petugas agak kerepotan.', 'Perawat yang jaga agar lebih teliti lg dalam memberikan pelayanan.\nkroscek kembali RM Pasien , evaluasi lg keluhan dan TTV pasien\nPerlu tambahan petugas yang jaga krn tidak sebanding dgn pasien.', '1. Memberikan Pembinaan pada Petugas yg jaga.\n2. Melaporkan pada koordinator dan Kasie Yanmed\n3. Melakukan investigasi sedehana', '2024-03-27', '2024-03-27', 'Dona Mariani', 'IYA', 'TIDAK', 'HIJAU'),
('2024-03-28', '06:00:00', '2024/03/24/000037', '- Tidak ada dokumentasi pemberian diet\n- Jam dinas petugas jaga tidak 24 jam', '- pemberian makanan cair langsung untuk 2 kali yang di berikan dalam waktu satu kali (susu jam 24.00 dam 06.00 wib diberikan pukul 21.00) karena jam kerja petugas dapur sudah selesai', '- membuat form khusus pemberian makanan cair (tanda terima)\n- jam dinas petugas dapur menjadi 3 sift', '- Unit gizi membuat form serah terima makanan cair yang di tanda tangani oleh perawat jaga, keluarga pasien dan petugas dapur\n- merekomendasi kan jam dinas petugas dapur menjadi 3 sift', '2024-04-28', '2024-04-28', 'Mega Utami, S.Gz', 'IYA', 'TIDAK', 'HIJAU'),
('2024-03-28', '10:00:00', '2024/03/24/000033', 'infus nya sdh terpasang dgn infus pump ,ternyata infus pump nya bunyi2 terus , untuk sementara di ilepas dulu sambil mengecek infus  set dan mengeluarkan udara.setelah udara dikeluarkan masih tetap  berbunyi2 lagi .dan infus pump nya di lepas ,dan mencari infus pump yg lain .\nkebetulan saat itu sr yuli juga bertugas mod malam , dan melakukan keliling ke unit-unit,\nsampai operan dgn  dinas pagi infus pump belom sempat terpasang.', 'kurang nya tenaga yg bisa  memback up unit  saat sr yuli keliling mod', 'supaya ada tambahan tenga perawat buat unit lantai 3.satu shif 2 orang perawat \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nagar ada tambahan ketenagaan di unit ranap 3.satu shif 2 orang yg jaga\napalagi dgn ke adaan ruangan full dan pasien anak2 .\nsebaik  nya petugas mod tdk merangkap pelayanan  ,apalagi dinas yg jaga 1 orang', 'Melaporkan kejadian ini pada Koordinator Rawat Inap, Kasie Pelayanan medis.', '2024-03-28', '2024-03-28', 'Dona Mariani', 'IYA', 'IYA', 'HIJAU'),
('2024-03-29', '09:00:29', '2024/03/27/000180', 'kesalahan penyalinan peresepan obat dari manual ke EMR', '- penulisan resep kurang terbaca dengan baik\n- konfirmasi pembacaan resep tidak pada dokter DPJP langsung melainkan kepada perawat OK\n- penulisan resep hanya di lakukan di CPPT , untuk resep manual tidak dilakukan penulisan semua resep\n- DU menginput resep ke EMR dibacakan oleh bidan, tidak membaca sendiri dari CPPT dokter', '- penuisan resep dengan jelas / langsung di tuliskan dengan EMR\n- jika penulisan manual dan tidak terbaca, konfirmasi kepada DPJP langsung\n- resep yang tertulis di CPPT harus sesuai dengan resep yang tertulis dalam resep manual', '- mendorong PJ unit OK untuk mengingatkan DPJP agar resep menginput langsung ke EMR\n- DU konfirmasi obat yang tidak terbaca langsung ke DPJP , membaca sendiri resep yang diberikan oleh DPJP', '2024-03-29', '2024-04-26', 'Lasmawati , S.Tr.Keb', 'IYA', 'TIDAK', 'BIRU'),
('2024-04-24', '11:35:38', '2024/04/24/000023', 'brankar tidak mengunci', 'bukan supir asli jadwal ambulan, supir asli sedang dirawat di RSICP dan supir KDO/perbantuan sedang tidak ditempat', 'supir perbantuan stand by ditempat untuk rujukan dan KDO diserahkan ke unit yg membutuhkan agar memakai supir sendiri', '1. mengecek kelengkapan sarpras(brankar,alat bantu,mobil) setiap hari \n2. mengupdate ilmu/training/TOT ilmu2 baru', '2024-04-24', '2024-04-26', 'kuncoro adi', 'IYA', 'TIDAK', 'KUNING');
