('2020-04-20', '11:10:20', '004001', 'PERINA', 'PERAWAT', 'Jam 23.00 akan memberikan terapi obat gentamycin ke ps By Ny Noviera (0 hari)  dengan dx susp NSAD , Ibu Hbsag (+)\nyang berada di dalam inkubator ..\nsaya memberikan melalui lubang tangan , saat akan menutup jarum , tidak sengaja tertusuk ke jari tengah tangan sebelah kiri saya', '-', 'TERTUSUK JARUM BEKAS PASIEN', 'JENNIFER SERLIN', 'Cuci dengan air mengalir dan sabun , lalu Lapor melalui wa ke PJ Ruangan , berobat ke IGD oleh dr Wynne anjuran utk cek lab HBSAG dan HIV\njam 23.15 diambil darah oleh mas yudi lab\nkeluar hasil lab jam 23.45 (Hasil Negatif)', 'NOVIANTI INDAH', 'NS. MIANNA SIBUEA S.KEP'),
