('2022-05-13', '10:05:14', '025769', 'lantai 4 rawat jalan', 'pemasangan instalasi listrik', 'pada saat pak juanda memasang instalasi listrik, tidak terlihat ada besi hollow yang tajam, menyebabkan luka gores pada lengan kanan sepanjang 15 cm', 'tidak ada', 'luka gores sepanjang 15 cm', 'Agus', 'Pak juanda langsung menuju igd, pembersihan luka kemudian diberi kasa dan betadine', 'Juanda', 'mohamad Zainal arifin'),
