('2022-07-08', '07:00:00', '046584', 'Rawat Inap', 'perawat', 'Pasien dewasa rawat inap mengeluh bagian pemasangan infus terasa nyeri dan bengkak. Perawat Dira mengobservasi area pemasangan infus pasien, melepas infus dan melakukan kompres pada area tangan yg bengkak.\nPerawat Dira melakukan pemasangan infus lagi pada pasien tersebut karna pasien masih mendapatkan cairan infus dan obat injeksi, pada saat pemasangan infus yang pertama tidak berhasil. Perawat Dira melepas abocath yg masih terpasang di  pasien dan saat itu pula jarum menembus handscoen dan jari', NULL, 'tertusuk jarum', 'ika amelia', '1. Mencuci area yg tertusuk jarum dengan air mengalir (di jempol tangan kiri)\n2. Melakukan pemeriksaan di igd oleh dokter jaga (dr. Suci)\n3. Melakukan pemeriksaan skrining dan labolatorium pada dira dan pasien \n4. Melaporkan kejadian ke penanggung jawab ruangan\n5. Melakukan pelaporan ke synergy dan penganggung jawab K3RS', 'dira hasti', 'nurul rahma'),
('2022-09-20', '10:30:15', '025769', 'gudang IPSRS', 'pemasangan karpet pada tangga bed', 'pada saat pemotongan perlak sebagai penganti karpet tangga bed, tidak sengaja mengenai jari', 'tidak ada', 'terluka sebesar 1 cm', 'ahmad sulaiman', 'pak juanda langsung ke IGD, pembersihan luka kemudian diberi betadine dan kasa untuk menutupi luka.', 'juanda', 'Mohamad Zainal Arifin'),
