('2022-10-10', '10:25:08', '010602', 'Ramp lantai 2', 'pengecekan kebocoran pada lantai', 'disaat pencarian kebocoran pad aramp lantai dua, tidak terlihat terdapat pipa yang tajam, ingin menganti pipa tersebut  menyebabkan jari telunjuk sebelah tangan kiri luka potong bagian luar 1 cm', 'tidak ada', 'luka terpotong sebesar 1 cm', 'Juanda', 'segera ke igd, pembersihan luka  dan pemberian betadine dan kasa untuk menutupi luka', 'Mohamad Zainal Arifin', 'Mohamad Zainal Arifin'),
('2023-08-13', '05:15:00', '045608', 'ranap 2 (ruang garuda)', 'perawat', 'perawat sudah memakai apd (handscoon, nursecap, gouwn, n95), saat akan menyuntikkan insulin, jarum insulin di pasien sudah tidak ada tutupnya. melepas jarum yg tidak ada tutup dan mengganti dengan jarum insulin yang baru. saat akan membuang jarum insilin yg tidak ada tutupnya, jarum tersangkut di handscoon dan menusuk ke ibu jari tangan kanan.', '-', 'luka tusuk jarum', 'wewen kristiawan', '1. Mencuci area yg tertusuk jarum dengan air mengalir (di jempol tangan kanan)\n2. Melakukan pemeriksaan di igd oleh dokter jaga (dr. Dona)\n3. Melakukan pemeriksaan skrining dan labolatorium pada ambar dan pasien \n4. Melaporkan kejadian ke penanggung jawab ruangan (imansyah)\n5. Melakukan pelaporan ke synergy dan penganggung jawab K3RS', 'dwi ambarwati', 'imansyah L.Ode'),
('2023-12-28', '10:50:01', '073954', 'UGD', 'PERAWAT', 'PETUGAS LAB MELAKUKAN PENGAMBILAN DARAH ANAK DI UGD, TETAPI TIDAK BERHASIL LALU PETUGAS AKAN MELAKUKAN RECAPING JARUM INFUS TIBA TIBA PERAWAT ICHWAN TENGANNYA MELINTAS JADI TERTUSUK JARUM', '-', 'LUKA TUSUK JARUM', 'AGUNG PRIYANTO', 'LUKA DIBERSIHKAN , PRIKSA LABORATORIUM, LAPOR IPCN, LAPOR PJ LLAU BEROBAT KE POLI PD', 'ANIK PURWANTI', 'AGUNG PRIYANTO'),
('2024-01-26', '10:25:14', '073419', 'Rawat Inap 2', 'Perawat', 'Korban sedang memasang infus pasien di ruang garuda, setelah selesai korban akan merapikan sisa pemasangan infus, ternyata didalam bak ada jarum bekas perawat sebelumnya yang tidak ditutup sehingga menusuk ke tangan korban.', 'tidak ada', 'luka tusuk jarum', 'Dwi Tya', '- Mencuci jari tangan yang tertusuk dengan air mengalir dan sabun antiseptik \n- Melapor ke bagian PJ unit, K3RS dan PPI \n- Korban dilakukan pemeriksaan oleh dokter UGD dan diambil sample darah HBSag dan HIV hasil negatif \n- Pasien tidak diambil darah karena pasien langsung dirujuk saat itu', 'Ikhtiar', 'Febri Eni'),
('2024-02-01', '02:50:01', '073980', 'HCU', 'PERAWAT', 'petugas sedang mengambiil darah AGD, kemudia pasie tiba-tiba memberontak dan tangannya menangkis petugas, sehingga perawat spontan kaget dan tertusuk jarum di bagian tangan (jari telunjuk)', '-', 'LUKA TUSUK JARUM', 'Mukti H', '-cuci luka dengan air mengalir dan antiseptic\nperiksa lab (pasien dan perawat) anti HIV dan HbsAg hasil non reactiv\nsudah konsul k PPI dan tim HIV', 'RIZLA SYABANNI', 'DWI PURNOMO'),
('2024-02-06', '03:30:00', '096514', 'KAMAR BEDAH', 'DOKTER SPESIALIS', 'DOKTER SEDANG MELAKUKAN OPERASI DAN MENJAHIT PASIEN OPERASI, TIBA TIBA TANGAN TERTUSUK JARUM JAHIT', '-', 'LUKA TUSUK JARUM JAHIT', 'RATNA', 'LUKA DICUCI DENGAN ANTISEPTIK KEMUDIAN MELANJUTKAN OPERASI\nPASIEN DILAKUKAN CEK ANTI HIV DAN ANTI HBSG HASIL NEGATIV\nPETUGAS TIDAK MAU DI CEK ANTI HIV DAN ANTI HBSAG SURAT PENOLAKAN SUDAH \nSUDAH LAPOR TIM PPI DAN TIM HIV', 'RATNA', 'IMANSYAH'),
('2024-07-01', '02:00:00', '099647', 'Kamar Operasi', 'DOkter Spesialis', 'Petugas sedang melakukan operasi herniatomy, tiba tiba saat hacting jarum meleset mengenai jari tulunjuk sebelah kiri.', 'luka tusuk jarum', 'luka tusuk jarum jari telunjuk sebelah kiri', 'ambarwati', 'Cuci dengan air mengalir dan sabun\n- Lapor PJ unit dilanjutkan ke Komite PPI dan K3RS \n- Berobat ke UGD \n- Pemeriksaan Lab Hbsag dan anti HIV petugas dan juga pasien', 'Ambarwati', 'Imansyah Latif Ode');
