('2019-10-17', '05:30:10', '015508', 'Ditemukan lanset di sampah kuning di kamar mandi Rajawali. CS tanpa mengetahui ada nya lanset di plastik kuning sehingga cs tertusuk dgn lanset saat akan membuang sampah tsb.', 'lanset dan sampah medis lain di ruang Rajawali tsb diambil dari kantong plastik kuning menggunakan tangan utk dijadikan satu dgn sampah medis lain krn jumlah nya sedikit.', 'kurang memperhatikan Spo yg ada.', 'mengambil sampah pakai tangan sendiri tanpa memikirkan ada benda tajam di kantong plastik kuning,yg seharusnya mengangkat kantong plastik sampah dan lsg membuang ke kantong sampah medis besar.', 'sarana sdh lengkap.', 'kurang melaksanakan prosedur.', '1 . Memberikan edukasi terhadap pasien agar tdk membuang benda tajam di tempat sampah kuning.', '2.Memberikan edukasi kpd pasien bahwa tdk boleh melakukan tindakan medis di lingkungan RS tanpa sepengetahuan petugas RS.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ns Mianna Sibuea S Kep.', 'dr. Finan', '2019-10-17', '2019-10-17', '2019-10-18'),
