INSERT INTO `sikat_table` (`id`, `nm_menu`, `nm_table`, `is_minggu`, `is_bulan`, `is_tahun`, `is_unit`, `is_dokter`, `is_ruang`, `is_umum_bpjs`, `is_start_date`, `is_end_date`, `span_header1`, `span_header2`, `column_title`, `column_key`, `query`) VALUES
(1, 'Loket:fas fa-table:99#Laporan Kunjungan', 'Laporan Kunjungan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'select \'Rawat Jalan\' as \'Kunjungan\', Baru, Lama,Batal, Baru+Lama as \'Total\'  from \n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Baru\'\nFROM reg_periksa\nWHERE reg_periksa.status_lanjut = \'Ralan\'\nAND reg_periksa.stts_daftar = \'Baru\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRalanBaru,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Lama\'\nFROM reg_periksa\nWHERE reg_periksa.status_lanjut = \'Ralan\'\nAND reg_periksa.stts_daftar = \'Lama\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRalanLama,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Batal\'\nFROM reg_periksa\nWHERE reg_periksa.stts = \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjBatal\n\nunion all\n\nselect \'Rawat Inap\' as \'Kunjungan\', Baru, Lama,Batal, Baru+Lama as \'Total\'  from \n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS Baru\nFROM reg_periksa\nWHERE reg_periksa.status_lanjut = \'Ranap\'\nAND reg_periksa.stts_daftar = \'Baru\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRanapBaru,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS Lama\nFROM reg_periksa\nWHERE reg_periksa.status_lanjut = \'Ranap\'\nAND reg_periksa.stts_daftar = \'Lama\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRanapLama,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Batal\'\nFROM reg_periksa\nWHERE reg_periksa.stts = \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjBatal\n;'),
(2, 'Loket:fas fa-table:99#Laporan Kunjungan Per Poli', 'Laporan Kunjungan Per Poli', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT poli.nm_poli as \'Nama Poliklinik\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.status_lanjut = \'Ralan\'\n		AND reg_periksa.stts_daftar = \'Baru\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan Pasien Baru\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.status_lanjut = \'Ralan\'\n		AND reg_periksa.stts_daftar = \'Lama\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS  \'Rawat Jalan Pasien Lama\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.status_lanjut = \'Ralan\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS  \'Rawat Jalan Pasien Total\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.status_lanjut = \'Ranap\'\n		AND reg_periksa.stts_daftar = \'Baru\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS  \'Rawat Inap Pasien Baru\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.status_lanjut = \'Ranap\'\n		AND reg_periksa.stts_daftar = \'Lama\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS  \'Rawat Inap Pasien Lama\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.status_lanjut = \'Ranap\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS  \'Rawat Inap Pasien Total\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.stts = \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Batal\',\n	(SELECT COUNT(*)\n		FROM reg_periksa\n		WHERE reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS Total\nFROM poliklinik AS poli \nORDER BY poli.kd_poli;'),
(3, 'Loket:fas fa-table:99#Laporan Cara Bayar', 'Laporan Cara Bayar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT poli.nm_poli as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C01\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Umum\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C02\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS PBI\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C03\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Askes\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C04\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Mandiri\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C05\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Ketenagakerjaan\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C06\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Karyawan\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj = \'C07\'\n		AND reg_periksa.stts != \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Gratis\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.stts = \'Batal\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Batal\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, penjab\n		WHERE reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_poli = poli.kd_poli\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\'\nFROM poliklinik AS poli \nORDER BY poli.kd_poli;'),
(4, 'Loket:fas fa-table:99#Laporan Rujukan', 'Laporan Rujukan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'select rjk_msk as \'Rujuk Masuk\', rjk_kel as \'Rujuk Keluar\', rjk_msk+rjk_kel as \'Total\' from \n(SELECT COUNT(*) as rjk_msk\nFROM rujuk_masuk, reg_periksa\nWHERE rujuk_masuk.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) masuk,\n(SELECT COUNT(*) as rjk_kel\nFROM rujuk, reg_periksa\nWHERE rujuk.no_rawat = reg_periksa.no_rawat\nAND rujuk.tgl_rujuk BETWEEN #START_DATE# AND #END_DATE#) keluar\n;'),
(5, 'Laboratorium#Laporan Tindakan', 'Laporan Tindakan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT a.nm_perawatan as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, poliklinik\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND lab.status = \'Ralan\'\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, poliklinik\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND lab.status = \'Ranap\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n		) AS \'Rawat Inap\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, poliklinik\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND lab.status = \'Ralan\'\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'IGD\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, poliklinik\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\'\nFROM jns_perawatan_lab AS a \nWHERE a.kd_jenis_prw like \'j%\' \nORDER BY a.kd_jenis_prw'),
(6, 'Laboratorium#Laporan Cara Bayar', 'Laporan Cara Bayar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT a.nm_perawatan as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C01\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Umum\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND penjab.kd_pj = \'C02\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS PBI\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND penjab.kd_pj = \'C03\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Askes\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND penjab.kd_pj = \'C04\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Mandiri\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND penjab.kd_pj = \'C05\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Ketenagakerjaan\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND penjab.kd_pj = \'C06\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Karyawan\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND penjab.kd_pj = \'C07\'\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Gratis\',\n	(SELECT COUNT(*)\n		FROM periksa_lab lab, reg_periksa, penjab\n		WHERE lab.kd_jenis_prw = a.kd_jenis_prw\n		AND lab.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND lab.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\' \nFROM jns_perawatan_lab AS a \nWHERE a.kd_jenis_prw like \'j%\' \nORDER BY a.kd_jenis_prw'),
(7, 'Laboratorium#Laporan Kunjungan', 'Laporan Kunjungan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'select \'Rawat Jalan\' as \'Kunjungan\', Baru, Lama,Batal, Baru+Lama as \'Total\'  from \n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Baru\'\nFROM periksa_lab, reg_periksa\nWHERE periksa_lab.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ralan\'\nAND reg_periksa.stts_daftar = \'Baru\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRalanBaru,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Lama\'\nFROM periksa_lab, reg_periksa\nWHERE periksa_lab.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ralan\'\nAND reg_periksa.stts_daftar = \'Lama\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRalanLama,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Batal\'\nFROM periksa_lab, reg_periksa\nWHERE periksa_lab.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.stts = \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjBatal\n\nunion all\n\nselect \'Rawat Inap\' as \'Kunjungan\', Baru, Lama,Batal, Baru+Lama as \'Total\'  from \n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS Baru\nFROM periksa_lab, reg_periksa\nWHERE periksa_lab.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ranap\'\nAND reg_periksa.stts_daftar = \'Baru\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRanapBaru,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS Lama\nFROM periksa_lab, reg_periksa\nWHERE periksa_lab.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ranap\'\nAND reg_periksa.stts_daftar = \'Lama\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRanapLama,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Batal\'\nFROM periksa_lab, reg_periksa\nWHERE periksa_lab.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.stts = \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjBatal\n;'),
(8, 'Radiologi#Laporan Tindakan', 'Laporan Tindakan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT a.nm_perawatan as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, poliklinik\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND rad.status = \'Ralan\'\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, poliklinik\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND rad.status = \'Ranap\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n		) AS \'Rawat Jalan\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, poliklinik\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND rad.status = \'Ralan\'\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'IGD\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, poliklinik\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\' \nFROM jns_perawatan_radiologi AS a \nWHERE a.kd_jenis_prw like \'x%\' \nORDER BY a.kd_jenis_prw'),
(9, 'Radiologi#Laporan Cara Bayar', 'Laporan Cara Bayar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT a.nm_perawatan as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj = penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C01\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Umum\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C02\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS PBI\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C03\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Askes\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C04\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Mandiri\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C05\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'BPJS Ketenagakerjaan\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C06\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Karyawan\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND reg_periksa.kd_pj = \'C07\'\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Gratis\',\n	(SELECT COUNT(*)\n		FROM periksa_radiologi rad, reg_periksa, penjab\n		WHERE rad.kd_jenis_prw = a.kd_jenis_prw\n		AND rad.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_pj= penjab.kd_pj\n		AND rad.tgl_periksa BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\' \nFROM jns_perawatan_radiologi AS a \nWHERE a.kd_jenis_prw like \'x%\' \nORDER BY a.kd_jenis_prw'),
(10, 'Radiologi#Laporan Kunjungan', 'Laporan Kunjungan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'select \'Rawat Jalan\' as \'Kunjungan\', Baru, Lama,Batal, Baru+Lama as \'Total\'  from \n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Baru\'\nFROM periksa_radiologi, reg_periksa\nWHERE periksa_radiologi.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ralan\'\nAND reg_periksa.stts_daftar = \'Baru\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRalanBaru,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Lama\'\nFROM periksa_radiologi, reg_periksa\nWHERE periksa_radiologi.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ralan\'\nAND reg_periksa.stts_daftar = \'Lama\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRalanLama,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Batal\'\nFROM periksa_radiologi, reg_periksa\nWHERE periksa_radiologi.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.stts = \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjBatal\n\nunion all\n\nselect \'Rawat Inap\' as \'Kunjungan\', Baru, Lama,Batal, Baru+Lama as \'Total\'  from \n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS Baru\nFROM periksa_radiologi, reg_periksa\nWHERE periksa_radiologi.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ranap\'\nAND reg_periksa.stts_daftar = \'Baru\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRanapBaru,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS Lama\nFROM periksa_radiologi, reg_periksa\nWHERE periksa_radiologi.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.status_lanjut = \'Ranap\'\nAND reg_periksa.stts_daftar = \'Lama\'\nAND reg_periksa.stts != \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjRanapLama,\n\n(SELECT COUNT(DISTINCT reg_periksa.no_rawat) AS \'Batal\'\nFROM periksa_radiologi, reg_periksa\nWHERE periksa_radiologi.no_rawat = reg_periksa.no_rawat\nAND reg_periksa.stts = \'Batal\'\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#) kunjBatal\n;'),
(11, 'Rawat Jalan#Laporan Tindakan', 'Laporan Tindakan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT poli.nm_poli as \'Nama Poliklinik\',\n	(SELECT COUNT(*)\n	FROM reg_periksa, rawat_jl_dr\n	WHERE reg_periksa.kd_poli = poli.kd_poli\n	AND reg_periksa.no_rawat = rawat_jl_dr.no_rawat\n	AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Tindakan Dokter\',\n	(SELECT COUNT(*)\n	FROM reg_periksa, rawat_jl_pr\n	WHERE reg_periksa.kd_poli = poli.kd_poli\n	AND reg_periksa.no_rawat = rawat_jl_pr.no_rawat\n	AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Tindakan Perawat\',\n	(SELECT COUNT(*)\n	FROM reg_periksa, rawat_jl_drpr\n	WHERE reg_periksa.kd_poli = poli.kd_poli\n	AND reg_periksa.no_rawat = rawat_jl_drpr.no_rawat\n	AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Tindakan Dokter & Perawat\',\n	(SELECT COUNT(*)\n	FROM reg_periksa, rawat_jl_dr\n	WHERE reg_periksa.kd_poli = poli.kd_poli\n	AND reg_periksa.no_rawat = rawat_jl_dr.no_rawat\n	AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) + \n	(SELECT COUNT(*)\n	FROM reg_periksa, rawat_jl_pr\n	WHERE reg_periksa.kd_poli = poli.kd_poli\n	AND reg_periksa.no_rawat = rawat_jl_pr.no_rawat\n	AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n	FROM reg_periksa, rawat_jl_drpr\n	WHERE reg_periksa.kd_poli = poli.kd_poli\n	AND reg_periksa.no_rawat = rawat_jl_drpr.no_rawat\n	AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\'\nFROM poliklinik AS poli \nORDER BY poli.kd_poli'),
(12, 'Rawat Jalan#Laporan Jenis Tindakan Per Poli', 'Laporan Jenis Tindakan Per Poli', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT jns_perawatan.nm_perawatan as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_dr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_dr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_dr.no_rawat\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan Tindakan Dokter\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_pr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_pr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_pr.no_rawat\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan Tindakan Perawat\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_drpr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_drpr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_drpr.no_rawat\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan Tindakan Dokter & Perawat\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_dr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_dr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_dr.no_rawat\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'IGD Tindakan Dokter\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_pr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_pr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_pr.no_rawat\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'IGD Tindakan Perawat\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_drpr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_drpr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_drpr.no_rawat\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'IGD Tindakan Dokter & Perawat\',\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_dr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_dr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_dr.no_rawat\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_pr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_pr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_pr.no_rawat\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_drpr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_drpr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_drpr.no_rawat\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_dr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_dr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_dr.no_rawat\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_pr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_pr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_pr.no_rawat\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM reg_periksa, rawat_jl_drpr, poliklinik\n		WHERE reg_periksa.kd_poli = poliklinik.kd_poli\n		AND jns_perawatan.kd_jenis_prw = rawat_jl_drpr.kd_jenis_prw\n		AND reg_periksa.no_rawat = rawat_jl_drpr.no_rawat\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\'\nFROM jns_perawatan\nORDER BY jns_perawatan.kd_jenis_prw'),
(13, 'Rawat Inap#Laporan Tindakan', 'Laporan Tindakan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT bangsal.nm_bangsal as \'Nama Ruangan\', \n	(SELECT COUNT(*) \n	FROM kamar, kamar_inap, rawat_inap_dr, reg_periksa\n	WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar_inap.no_rawat = reg_periksa.no_rawat\n	AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n	AND kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar.kd_bangsal = bangsal.kd_bangsal\n	AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Tindakan Dokter\',\n	(SELECT COUNT(*) \n	FROM kamar, kamar_inap, rawat_inap_pr, reg_periksa\n	WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar_inap.no_rawat = reg_periksa.no_rawat\n	AND kamar_inap.no_rawat = rawat_inap_pr.no_rawat\n	AND kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar.kd_bangsal = bangsal.kd_bangsal\n	AND rawat_inap_pr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Tindakan Perawat\',\n	(SELECT COUNT(*) \n	FROM kamar, kamar_inap, rawat_inap_drpr, reg_periksa\n	WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar_inap.no_rawat = reg_periksa.no_rawat\n	AND kamar_inap.no_rawat = rawat_inap_drpr.no_rawat\n	AND kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar.kd_bangsal = bangsal.kd_bangsal\n	AND rawat_inap_drpr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Tindakan Dokter & Perawat\',\n	(SELECT COUNT(*) \n	FROM kamar, kamar_inap, rawat_inap_dr, reg_periksa\n	WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar_inap.no_rawat = reg_periksa.no_rawat\n	AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n	AND kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar.kd_bangsal = bangsal.kd_bangsal\n	AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*) \n	FROM kamar, kamar_inap, rawat_inap_pr, reg_periksa\n	WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar_inap.no_rawat = reg_periksa.no_rawat\n	AND kamar_inap.no_rawat = rawat_inap_pr.no_rawat\n	AND kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar.kd_bangsal = bangsal.kd_bangsal\n	AND rawat_inap_pr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*) \n	FROM kamar, kamar_inap, rawat_inap_drpr, reg_periksa\n	WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar_inap.no_rawat = reg_periksa.no_rawat\n	AND kamar_inap.no_rawat = rawat_inap_drpr.no_rawat\n	AND kamar_inap.kd_kamar = kamar.kd_kamar\n	AND kamar.kd_bangsal = bangsal.kd_bangsal\n	AND rawat_inap_drpr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\'\nFROM bangsal\nWHERE bangsal.kd_bangsal \nIN (\'B0001\',\'B0002\',\'B0004\',\'B0005\', \'B0006\', \'B0020\', \'B0021\', \'B0022\', \'B0023\', \'B0024\', \'B0027\')\nORDER BY bangsal.kd_bangsal'),
(14, 'Rawat Inap#Laporan Jenis Tindakan Per Kamar', 'Laporan Jenis Tindakan Per Kamar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT jns_perawatan_inap.nm_perawatan as \'Nama Tindakan\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0001\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'HCU\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0002\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Anak\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0004\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Kebidanan\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0005\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Pria\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0006\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Wanita\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0020\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Perina\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0021\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'OK\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0022\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'VK\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0023\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Observasi\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0024\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Isolasi\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0027\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'ODC\',\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0001\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0002\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0004\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0005\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0006\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0020\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0021\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0022\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0023\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0024\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) +\n	(SELECT COUNT(*)\n		FROM kamar_inap, rawat_inap_dr, kamar, bangsal\n		WHERE kamar_inap.kd_kamar = kamar.kd_kamar\n		AND jns_perawatan_inap.kd_jenis_prw = rawat_inap_dr.kd_jenis_prw\n		AND kamar_inap.no_rawat = rawat_inap_dr.no_rawat\n		AND kamar.kd_bangsal = bangsal.kd_bangsal\n		AND bangsal.kd_bangsal = \'B0027\'\n		AND rawat_inap_dr.tgl_perawatan BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\'\n	FROM jns_perawatan_inap\n	ORDER BY jns_perawatan_inap.kd_jenis_prw'),
(15, 'Rujuk Balik#Laporan PRB', 'Laporan PRB', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT pasien.nm_pasien as \'Nama Pasien\', diagnosa_pasien.kd_penyakit as \'Diagnosa\', penyakit.nm_penyakit as \'Nama Penyakit\', pasien.alamat as \'Alamat\', kelurahan.nm_kel as \'Kelurahan\',\nkecamatan.nm_kec as \'Kecamatan\', kabupaten.nm_kab as \'Kabupaten\', reg_periksa.status_lanjut as \'Status Rawat\', rujuk_masuk.perujuk as \'Asal Rujukan\'\nFROM `pasien`, diagnosa_pasien, reg_periksa, kelurahan, kecamatan, kabupaten, penyakit, rujuk_masuk\nWHERE reg_periksa.no_rkm_medis = pasien.no_rkm_medis\nAND pasien.kd_kel = kelurahan.kd_kel\nAND pasien.kd_kec = kecamatan.kd_kec\nAND pasien.kd_kab = kabupaten.kd_kab\nAND reg_periksa.no_rawat = diagnosa_pasien.no_rawat\nAND diagnosa_pasien.kd_penyakit = penyakit.kd_penyakit\nAND reg_periksa.no_rawat = rujuk_masuk.no_rawat\nAND kecamatan.kd_kec IN (\'3\',\'5\',\'7013\')\nAND diagnosa_pasien.kd_penyakit IN (\'E14\',\'E14.0\',\'E14.1\',\'E14.2\',\'E14.3\',\'E14.4\',\'E14.5\',\'E14.6\',\'E14.7\',\'E14.8\',\'E14.9\'\n,\'I10\'\n,\'J45\',\'J45.0\',\'J45.1\',\'J45.8\',\'J45.9\'\n,\'I64\'\n,\'G40\',\'G40.0\',\'G40.1\',\'G40.2\',\'G40.3\',\'G40.4\',\'G40.5\',\'G40.6\',\'G40.7\',\'G40.8\',\'G40.9\'\n,\'I2\',\'I25.0\',\'I25.1\',\'I25.2\',\'I25.3\',\'I25.4\',\'I25.5\',\'I25.6\',\'I25.8\',\'I25.9\'\n,\'J44\',\'J44.0\',\'J44.1\',\'J44.8\',\'J44.9\'\n,\'F20\',\'F20.0\',\'F20.1\',\'F20.2\',\'F20.3\',\'F20.4\',\'F20.5\',\'F20.6\',\'F20.8\',\'F20.9\'\n,\'M32\',\'M32.0\',\'M32.1\',\'M32.8\',\'M32.9\'\n)\nAND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\nORDER BY reg_periksa.tgl_registrasi'),
(16, 'Populasi:fas fa-table:100#Laporan Populasi', 'Laporan Populasi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT pasien.no_rkm_medis as \'No. RM\', pasien.nm_pasien as \'Nama Pasien\', pasien.no_ktp as \'No. KTP\', pasien.jk as \'J.K.\', pasien.tgl_daftar as \'Tanggal Daftar\', pasien.tmp_lahir as \'Tempat Lahir\',\npasien.tgl_lahir as \'Tanggal Lahir\', pasien.alamat as \'Alamat\',kelurahan.nm_kel as \'Kelurahan\',kecamatan.nm_kec as \'Kecamatan\',kabupaten.nm_kab as \'Kabupaten\',propinsi.nm_prop as \'Provinsi\',\npasien.gol_darah as \'Gol. Darah\',pasien.pekerjaan as \'Pekerjaan\',pasien.stts_nikah as \'Status Nikah\', pasien.agama as \'Agama\', pasien.no_tlp as \'No. Telepon\', pasien.umur as \'Umur\',\npasien.pnd as \'Pendidikan\', suku_bangsa.nama_suku_bangsa as \'Suku Bangsa\', bahasa_pasien.nama_bahasa as \'Bahasa\',cacat_fisik.nama_cacat as \'Cacat Fisik\' \nFROM pasien,kelurahan,kecamatan,kabupaten,suku_bangsa,bahasa_pasien,cacat_fisik,propinsi,penjab\nWHERE pasien.kd_kel = kelurahan.kd_kel\nAND pasien.kd_kec = kecamatan.kd_kec\nAND pasien.kd_kab = kabupaten.kd_kab\nAND pasien.suku_bangsa = suku_bangsa.id\nAND pasien.bahasa_pasien = bahasa_pasien.id\nAND pasien.cacat_fisik = cacat_fisik.id\nAND pasien.kd_prop = propinsi.kd_prop\nAND pasien.kd_pj = penjab.kd_pj\nAND tgl_daftar BETWEEN #START_DATE# AND #END_DATE#\nORDER BY tgl_daftar ASC'),
(17, 'Diagnosa#Laporan Diagnosa Per-Kunjungan', 'Laporan Diagnosa Per-Kunjungan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, 'SELECT a.nm_penyakit as \'Nama Penyakit\', a.ciri_ciri as \'Ciri-ciri\',\n	(SELECT COUNT(*)\n		FROM diagnosa_pasien, reg_periksa, poliklinik\n		WHERE diagnosa_pasien.kd_penyakit = a.kd_penyakit\n		AND diagnosa_pasien.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND reg_periksa.status_lanjut = \'Ralan\'\n		AND poliklinik.kd_poli NOT IN (\'IGDK\')\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Rawat Jalan\',\n	(SELECT COUNT(*)\n		FROM diagnosa_pasien, reg_periksa, poliklinik\n		WHERE diagnosa_pasien.kd_penyakit = a.kd_penyakit\n		AND diagnosa_pasien.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND reg_periksa.status_lanjut = \'Ranap\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n		) AS \'Rawat Jalan\',\n	(SELECT COUNT(*)\n		FROM diagnosa_pasien, reg_periksa, poliklinik\n		WHERE diagnosa_pasien.kd_penyakit = a.kd_penyakit\n		AND diagnosa_pasien.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND reg_periksa.status_lanjut = \'Ralan\'\n		AND poliklinik.kd_poli = \'IGDK\'\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'IGD\',\n	(SELECT COUNT(*)\n		FROM diagnosa_pasien, reg_periksa, poliklinik\n		WHERE diagnosa_pasien.kd_penyakit = a.kd_penyakit\n		AND diagnosa_pasien.no_rawat = reg_periksa.no_rawat\n		AND reg_periksa.kd_poli = poliklinik.kd_poli\n		AND reg_periksa.tgl_registrasi BETWEEN #START_DATE# AND #END_DATE#\n	) AS \'Total\' \nFROM penyakit AS a \nORDER BY Total DESC\nLIMIT 100'),
(19, 'Daftar 10 Pemakaian Obat Terbanyak:fas fa-table:001#Daftar 10 Pemakaian Obat Terbanyak', 'Daftar 10 Pemakaian Obat Terbanyak', NULL, NULL, 1, 1, NULL, NULL, 1, NULL, NULL, NULL, NULL, 'Nama Obat:400, Jumlah:200', 'nama_brng, jumlah', 'SELECT barang.nama_brng, SUM(pemberian.jml) as jumlah FROM detail_pemberian_obat pemberian \nleft join reg_periksa reg on pemberian.no_rawat=reg.no_rawat \nleft join databarang barang on pemberian.kode_brng=barang.kode_brng\nleft join penjab penjab on reg.kd_pj=penjab.kd_pj\nwhere reg.kd_poli = \'#UNIT#\' and\npenjab.png_jawab like \'%#UMUM_BPJS#%\' and\nYEAR(pemberian.tgl_perawatan) = #TAHUN#\ngroup by barang.nama_brng\norder by jumlah desc\nlimit 10'),
(23, 'RL 5.2:fas fa-table:002#Kunjungan Rawat Jalan (RL 5.2)', 'Laporan Kunjungan Rawat Jalan (RL 5.2)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jenis Kegiatan:400, Jumlah:200', 'nm_poli, jumlah', 'SELECT poliklinik.nm_poli, COUNT(reg_periksa.no_rawat) as jumlah FROM poliklinik \nleft join reg_periksa on reg_periksa.kd_poli=poliklinik.kd_poli\nwhere YEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN#\ngroup by poliklinik.kd_poli'),
(24, 'RL 5.4:fas fa-table:003#Daftar 10 Besar Penyakit Rawat Jalan (RL 5.4)', 'Laporan Daftar 10 Besar Penyakit Rawat Jalan (RL 5.4)', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kode ICD 10:150, Deskripsi:400, Kasus Baru Menurut Jenis Kelamin LK:150, Kasus Baru Menurut Jenis Kelamin PR:150, Jumlah Kasus Baru (4+5):120, Jumlah Kunjungan:200', 'kd_penyakit, nm_penyakit, baruLK, baruPR, jumlahBaru, jumlah', 'SELECT penyakit.kd_penyakit, penyakit.nm_penyakit, 0 as baruLK, 0 as baruPR, 0 as jumlahBaru,  COUNT(diagnosa_pasien.no_rawat) as jumlah FROM penyakit\nleft join diagnosa_pasien on penyakit.kd_penyakit=diagnosa_pasien.kd_penyakit\nleft join reg_periksa on diagnosa_pasien.no_rawat=reg_periksa.no_rawat\nwhere diagnosa_pasien.status = \'Ralan\' and\nreg_periksa.kd_poli = \'#UNIT#\' and\nYEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN#\ngroup by penyakit.nm_penyakit'),
(25, 'RL 3.14:fas fa-table:004#Kegiatan Rujukan (RL 3.14)', 'Laporan Kegiatan Rujukan (RL 3.14)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Jenis Spesialisasi:1, RUJUKAN:6, DIRUJUK:3', NULL, ':400, Diterima dari Puskesmas:150, Diterima dari Fasilitas Kesehatan Lain:150,Diterima dari RS Lain:150, Dikembalikan ke Puskesmas:150, Dikembalikan ke Fasilitas Kesehatan Lain:150, Dikembalikan ke RS Awal:150,Pasien Rujukan:120, Pasien Datang Sendiri:120, Diterima Kembali:120', 'nm_poli, dariPuskesmas, dariFasum, dariRS, kePuskesmas, keFasum, keRS, pasienRujuk, pasienDatangSendiri, pasienTerimaKembali', 'SELECT poliklinik.nm_poli, \nSUM(CASE WHEN rujuk_masuk.perujuk LIKE \'%PKM%\' THEN 1 ELSE 0 END) AS dariPuskesmas,\nSUM(CASE WHEN rujuk_masuk.perujuk NOT LIKE \'%PKM%\' and rujuk_masuk.perujuk NOT LIKE \'%RS%\' THEN 1 ELSE 0 END) AS dariFasum,\nSUM(CASE WHEN rujuk_masuk.perujuk LIKE \'%RS%\' THEN 1 ELSE 0 END) AS dariRS,\nSUM(CASE WHEN rujuk.rujuk_ke LIKE \'%PKM%\' THEN 1 ELSE 0 END) AS kePuskesmas,\nSUM(CASE WHEN rujuk.rujuk_ke NOT LIKE \'%PKM%\' and rujuk_masuk.perujuk NOT LIKE \'%RS%\' THEN 1 ELSE 0 END) AS keFasum,\nSUM(CASE WHEN rujuk.rujuk_ke LIKE \'%RS%\' THEN 1 ELSE 0 END) AS keRS,\nSUM(CASE WHEN rujuk.rujuk_ke IS NOT NULL THEN 1 ELSE 0 END) AS pasienRujuk,\nSUM(CASE WHEN rujuk.rujuk_ke IS NULL THEN 1 ELSE 0 END) AS pasienDatangSendiri,\n0 as pasienTerimaKembali FROM poliklinik \nleft join reg_periksa on reg_periksa.kd_poli=poliklinik.kd_poli\nleft join rujuk_masuk on rujuk_masuk.no_rawat=reg_periksa.no_rawat\nleft join rujuk on rujuk.no_rawat=reg_periksa.no_rawat\nwhere YEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN#\ngroup by poliklinik.kd_poli'),
(26, 'RL 3.3:fas fa-table:005#Kegiatan Kesehatan Gigi dan Mulut (RL 3.3)', 'Laporan Kegiatan Kesehatan Gigi dan Mulut (RL 3.3)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jenis Kegiatan:400, Jumlah:200', 'kegiatan, jumlah', 'SELECT \'Tumpatan Gigi Tetap\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Tumpatan Gigi Sulung\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Pengobatan Pulpa\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Pencabutan Gigi Tetap\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Pencabutan Gigi Sulung\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Pengobatan Periodontal\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Debridemen\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Therapy Stomatitis/ulcer\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Pengobatan Abses\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Bongkar Tambalan Amalgam\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Pembersihan Karang Gigi\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Prothese Lengkap\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Prothese Sebagian\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Prothese Cekat\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Orthodonti\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Jacket / Bridge\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Bedah Mulut\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Foto Gigi\' as kegiatan,0 as jumlah\nunion all\nSELECT \'Lain - lain\' as kegiatan,0 as jumlah');
INSERT INTO `sikat_table` (`id`, `nm_menu`, `nm_table`, `is_minggu`, `is_bulan`, `is_tahun`, `is_unit`, `is_dokter`, `is_ruang`, `is_umum_bpjs`, `is_start_date`, `is_end_date`, `span_header1`, `span_header2`, `column_title`, `column_key`, `query`) VALUES
(27, 'RL 3.12:fas fa-table:006#Kegiatan Pelayanan Keluarga Berencana (RL 3.12)', 'Laporan Kegiatan Pelayanan Keluarga Berencana (RL 3.12)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Metoda:1,Konseling:2,KB Baru dengan Cara Masuk:4,KB Baru dengan Kondisi:3,Kunjungan Ulang:1,Keluhan Efek:2', NULL, ':400,ANC:150,Pasca Persalinan:150,Bukan Rujukan:150,Rujukan R.Inap:150, Rujukan R.Jalan:150,Total:150,Pasca Persalinan/Nifas:150,Abortus:150,Lainnya:150,:150,JML:150,Dirujuk:150', 'metoda,anc,pascaSalin,bukanRujuk,rujukInap,rujukJalan,total,pascaNifas,abortus,lainnya,kunjunganUlang,jml,dirujuk', 'SELECT \'I U D\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'P i l\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'Kondom\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'Obat Vaginal\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'MO Pria\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'MO Wanita\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'Suntikan\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk\nunion all\nSELECT \'Implant\' as metoda,0 as anc,0 as pascaSalin,0 as bukanRujuk,0 as rujukInap,0 as rujukJalan,0 as total,0 as pascaNifas,0 as abortus,0 as lainnya,0 as kunjunganUlang,0 as jml,0 as dirujuk'),
(28, 'Kunjungan:fas fa-table:007#Laporan Kunjungan Pasien', 'Laporan Kunjungan Pasien', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 'TGL:1,JENIS KUNJ.:2,JML:1,JENIS PEMBAYARAN:6,JML:1,KUNJUNGAN BERDASARKAN USIA & JENIS KELAMIN:22,JML:1;:1, BARU:1, LAMA:1, :1, UMUM:1, BPJS:3,KARY:1,GRATIS:1,:1,0 - 6 HR:2, 7 - 28 HR:2,28 HR - < 1 TH:2,1-4 TH:2,5 - 14 TH:2,15 - 24 TH:2,25 - 44 TH:2,45 - 59 TH:2,60 TH:2,61 - 64 TH:2,> 65 TH:2,:1', NULL, ':100,:100,:100,:100,:100,MANDIRI:100,PBI:100,ASKES:100,:100,:100,:100,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,L:60,P:60,:100', 'tgl,baru,lama,jml1,umum,mandiri,pbi,askes,kary,gratis,jml2,l1,p1,l2,p2,l3,p3,l4,p4,l5,p5,l6,p6,l7,p7,l8,p8,l9,p9,l10,p10,l11,p11,jml3', 'select datelist.tgl, \nSUM(CASE WHEN reg_periksa.stts_daftar = \'Baru\' THEN 1 ELSE 0 END) as baru, \nSUM(CASE WHEN reg_periksa.stts_daftar = \'Lama\' THEN 1 ELSE 0 END) as lama,  \nCOUNT(reg_periksa.tgl_registrasi) as jml1,  \nSUM(CASE WHEN reg_periksa.kd_pj = \'C01\' THEN 1 ELSE 0 END) as umum, \nSUM(CASE WHEN reg_periksa.kd_pj = \'C04\' THEN 1 ELSE 0 END) as mandiri, \nSUM(CASE WHEN reg_periksa.kd_pj = \'C02\' THEN 1 ELSE 0 END) as pbi, \nSUM(CASE WHEN reg_periksa.kd_pj = \'C03\' THEN 1 ELSE 0 END) as askes, \nSUM(CASE WHEN reg_periksa.kd_pj = \'C06\' THEN 1 ELSE 0 END) as kary, \nSUM(CASE WHEN reg_periksa.kd_pj = \'C07\' THEN 1 ELSE 0 END) as gratis, \nSUM(CASE WHEN reg_periksa.kd_pj in (\'C01\', \'C02\', \'C03\', \'C04\', \'C06\', \'C07\') THEN 1 ELSE 0 END) as jml2, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Hr\' and reg_periksa.umurdaftar between 0 and 6 THEN 1 ELSE 0 END) as l1, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Hr\' and reg_periksa.umurdaftar between 0 and 6 THEN 1 ELSE 0 END) as p1, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Hr\' and reg_periksa.umurdaftar between 7 and 28 THEN 1 ELSE 0 END) as l2, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Hr\' and reg_periksa.umurdaftar between 7 and 28 THEN 1 ELSE 0 END) as p2, \nSUM(CASE WHEN (pasien.jk = \'L\' and reg_periksa.sttsumur = \'Hr\' and reg_periksa.umurdaftar >= 29) or (pasien.jk = \'L\' and reg_periksa.sttsumur = \'Bl\') THEN 1 ELSE 0 END) as l3, \nSUM(CASE WHEN (pasien.jk = \'P\' and reg_periksa.sttsumur = \'Hr\' and reg_periksa.umurdaftar >= 29) or (pasien.jk = \'P\' and reg_periksa.sttsumur = \'Bl\') THEN 1 ELSE 0 END) as p3, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 1 and 4 THEN 1 ELSE 0 END) as l4, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 1 and 4 THEN 1 ELSE 0 END) as p4, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 5 and 14 THEN 1 ELSE 0 END) as l5, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 5 and 14 THEN 1 ELSE 0 END) as p5, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 15 and 24 THEN 1 ELSE 0 END) as l6, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 15 and 24 THEN 1 ELSE 0 END) as p6, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 25 and 44 THEN 1 ELSE 0 END) as l7, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 25 and 44 THEN 1 ELSE 0 END) as p7, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 45 and 59 THEN 1 ELSE 0 END) as l8, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 45 and 59 THEN 1 ELSE 0 END) as p8, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar = 60 THEN 1 ELSE 0 END) as l9, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar = 60 THEN 1 ELSE 0 END) as p9, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 61 and 64 THEN 1 ELSE 0 END) as l10, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 61 and 64 THEN 1 ELSE 0 END) as p10, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar >= 65 THEN 1 ELSE 0 END) as l11, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar >= 65 THEN 1 ELSE 0 END) as p11, \nCOUNT(reg_periksa.tgl_registrasi) as jml3 from (\nselect	1	as tgl	union all\nselect	2	as tgl	union all\nselect	3	as tgl	union all\nselect	4	as tgl	union all\nselect	5	as tgl	union all\nselect	6	as tgl	union all\nselect	7	as tgl	union all\nselect	8	as tgl	union all\nselect	9	as tgl	union all\nselect	10	as tgl	union all\nselect	11	as tgl	union all\nselect	12	as tgl	union all\nselect	13	as tgl	union all\nselect	14	as tgl	union all\nselect	15	as tgl	union all\nselect	16	as tgl	union all\nselect	17	as tgl	union all\nselect	18	as tgl	union all\nselect	19	as tgl	union all\nselect	20	as tgl	union all\nselect	21	as tgl	union all\nselect	22	as tgl	union all\nselect	23	as tgl	union all\nselect	24	as tgl	union all\nselect	25	as tgl	union all\nselect	26	as tgl	union all\nselect	27	as tgl	union all\nselect	28	as tgl	union all\nselect	29	as tgl	union all\nselect	30	as tgl	union all\nselect	31	as tgl	\n) as datelist\nleft join reg_periksa on DAY(reg_periksa.tgl_registrasi) = datelist.tgl\nleft join pasien on pasien.no_rkm_medis = reg_periksa.no_rkm_medis\nwhere YEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN# and\nreg_periksa.kd_poli = \'#UNIT#\'\ngroup by reg_periksa.tgl_registrasi\norder by reg_periksa.tgl_registrasi'),
(29, 'Form 5A:fas fa-table:008#Surveilans Kasus PTM (Form 5A)', 'Laporan Surveilans Kasus PTM (Form 5A)', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 'Nama Penyakit:1,ICD X:1,Golongan Umur:14,Kasus Baru Menurut Seks:2,JML Kasus Baru:1,JML Kunjungan:1,Meninggal:1;:1,:1,<1 TH:2,1-4 TH:2,5-14 TH:2,15-24 TH:2,25-44 TH:2,45-64 TH:2,>65 TH:2,:2,:1,:1,:1', NULL, ':400, :200,L,P,L,P,L,P,L,P,L,P,L,P,L,P,L,P,:150,:150,:150', 'nm_penyakit,kd_penyakit,l1,p1,l2,p2,l3,p3,l4,p4,l5,p5,l6,p6,l7,p7,baruLK,baruPR,jumlahBaru,jumlahKunjungan,jumlahMeninggal', 'SELECT \npenyakit.nm_penyakit, \npenyakit.kd_penyakit, \nSUM(CASE WHEN (pasien.jk = \'L\' and reg_periksa.sttsumur = \'Hr\') or (pasien.jk = \'L\' and reg_periksa.sttsumur = \'Bl\') THEN 1 ELSE 0 END) as l1,\nSUM(CASE WHEN (pasien.jk = \'P\' and reg_periksa.sttsumur = \'Hr\') or (pasien.jk = \'P\' and reg_periksa.sttsumur = \'Bl\') THEN 1 ELSE 0 END) as p1,\nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 1 and 4 THEN 1 ELSE 0 END) as l2, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 1 and 4 THEN 1 ELSE 0 END) as p2, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 5 and 14 THEN 1 ELSE 0 END) as l3, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 5 and 14 THEN 1 ELSE 0 END) as p3, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 15 and 24 THEN 1 ELSE 0 END) as l4, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 15 and 24 THEN 1 ELSE 0 END) as p4, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 25 and 44 THEN 1 ELSE 0 END) as l5, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 25 and 44 THEN 1 ELSE 0 END) as p5, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 45 and 64 THEN 1 ELSE 0 END) as l6, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar between 45 and 64 THEN 1 ELSE 0 END) as p6, \nSUM(CASE WHEN pasien.jk = \'L\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar >= 65 THEN 1 ELSE 0 END) as l7, \nSUM(CASE WHEN pasien.jk = \'P\' and reg_periksa.sttsumur = \'Th\' and reg_periksa.umurdaftar >= 65 THEN 1 ELSE 0 END) as p7, \n0 as baruLK, \n0 as baruPR, \n0 as jumlahBaru,  \nCOUNT(diagnosa_pasien.no_rawat) as jumlahKunjungan,  \n0 as jumlahMeninggal FROM penyakit\nleft join diagnosa_pasien on penyakit.kd_penyakit=diagnosa_pasien.kd_penyakit\nleft join reg_periksa on diagnosa_pasien.no_rawat=reg_periksa.no_rawat\nleft join pasien on pasien.no_rkm_medis = reg_periksa.no_rkm_medis\nwhere diagnosa_pasien.status = \'Ralan\' and\nreg_periksa.kd_poli = \'#UNIT#\' and\nYEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN#\ngroup by penyakit.nm_penyakit'),
(30, 'Rujuk Masuk:fas fa-table:009#Laporan Rujukan Masuk', 'Laporan Rujukan Masuk', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diagnosa:400, Puskesmas:200, Rumah Sakit:200, Fasilitas Kesehatan Lain:200, Jumlah:200', 'diagnosa, puskesmas, rs, fasum, jumlah', 'SELECT penyakit.ciri_ciri as diagnosa, \nSUM(CASE WHEN rujuk_masuk.perujuk LIKE \'%PKM%\' THEN 1 ELSE 0 END) as puskesmas,\nSUM(CASE WHEN rujuk_masuk.perujuk LIKE \'%RS%\' THEN 1 ELSE 0 END) as rs,\nSUM(CASE WHEN rujuk_masuk.perujuk NOT LIKE \'%PKM%\' and rujuk_masuk.perujuk NOT LIKE \'%RS%\' THEN 1 ELSE 0 END) as fasum,\nCOUNT(rujuk_masuk.perujuk) as jumlah FROM rujuk_masuk \nleft join reg_periksa on reg_periksa.no_rawat=rujuk_masuk.no_rawat\nleft join diagnosa_pasien on diagnosa_pasien.no_rawat=rujuk_masuk.no_rawat\nleft join penyakit on penyakit.kd_penyakit=diagnosa_pasien.kd_penyakit\nwhere YEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN# and\nreg_periksa.kd_poli = \'#UNIT#\'\ngroup by penyakit.ciri_ciri'),
(31, 'Rujuk Keluar:fas fa-table:010#Laporan Rujukan Keluar', 'Laporan Rujukan Keluar', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diagnosa:400, Puskesmas:200, Rumah Sakit:200, Fasilitas Kesehatan Lain:200, Jumlah:200', 'diagnosa, puskesmas, rs, fasum, jumlah', 'SELECT penyakit.ciri_ciri as diagnosa, \nSUM(CASE WHEN rujuk.rujuk_ke LIKE \'%PKM%\' THEN 1 ELSE 0 END) as puskesmas,\nSUM(CASE WHEN rujuk.rujuk_ke LIKE \'%RS%\' THEN 1 ELSE 0 END) as rs,\nSUM(CASE WHEN rujuk.rujuk_ke NOT LIKE \'%PKM%\' and rujuk.rujuk_ke NOT LIKE \'%RS%\' THEN 1 ELSE 0 END) as fasum,\nCOUNT(rujuk.rujuk_ke) as jumlah FROM rujuk\nleft join reg_periksa on reg_periksa.no_rawat=rujuk.no_rawat\nleft join diagnosa_pasien on diagnosa_pasien.no_rawat=rujuk.no_rawat\nleft join penyakit on penyakit.kd_penyakit=diagnosa_pasien.kd_penyakit\nwhere YEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN# and\nreg_periksa.kd_poli = \'#UNIT#\'\ngroup by penyakit.ciri_ciri'),
(32, 'Tindakan Dokter:fas fa-table:011#Tindakan Dokter', 'Tindakan Dokter', NULL, 1, 1, 1, 1, NULL, NULL, NULL, NULL, 'Nama Tindakan:1,Jenis Pembayaran:6,Jumlah:1;:1,Umum:1,BPJS:3,Kary:1,Gratis:1,:1', NULL, ':400,:100,MANDIRI:100,PBI:100,ASKES:100,:100,:100,:100', 'tindakan, umum,mandiri,pbi,askes,kary,gratis,jumlah', 'select \'-\' as tindakan, 0 as umum, 0 as mandiri, 0 as pbi, 0 as askes, 0 as kary, 0 as gratis, 0 as jumlah'),
(33, 'Tindakan:fas fa-table:012#Laporan Tindakan', 'Laporan Tindakan', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 'TGL:1,Jenis Tindakan:6,Jumlah:1', NULL, ':50, tindakan 1:200,tindakan 2:200,tindakan 3:200,tindakan 4:200,tindakan 5:200,tindakan 6:200,:150', 'tgl, tind1,tind2,tind3,tind4,tind5,tind6,jumlah', 'select datelist.tgl, \'\' as tind1,\'\' as tind2,\'\' as tind3,\'\' as tind4,\'\' as tind5,\'\' as tind6,0 as jumlah from (\nselect	1	as tgl	union all\nselect	2	as tgl	union all\nselect	3	as tgl	union all\nselect	4	as tgl	union all\nselect	5	as tgl	union all\nselect	6	as tgl	union all\nselect	7	as tgl	union all\nselect	8	as tgl	union all\nselect	9	as tgl	union all\nselect	10	as tgl	union all\nselect	11	as tgl	union all\nselect	12	as tgl	union all\nselect	13	as tgl	union all\nselect	14	as tgl	union all\nselect	15	as tgl	union all\nselect	16	as tgl	union all\nselect	17	as tgl	union all\nselect	18	as tgl	union all\nselect	19	as tgl	union all\nselect	20	as tgl	union all\nselect	21	as tgl	union all\nselect	22	as tgl	union all\nselect	23	as tgl	union all\nselect	24	as tgl	union all\nselect	25	as tgl	union all\nselect	26	as tgl	union all\nselect	27	as tgl	union all\nselect	28	as tgl	union all\nselect	29	as tgl	union all\nselect	30	as tgl	union all\nselect	31	as tgl	\n) as datelist'),
(34, 'Transfusi:fas fa-table:013#Tindakan Transfusi Darah', 'Laporan Tindakan Transfusi Darah', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nama Pasien:400, Jumlah CC:200, Jumlah Kantong: 200', 'pasien, jumlahcc, jumlahkantong', 'SELECT \'-\' as pasien, 0 as jumlahcc, 0 as jumlahkantong'),
(35, 'RL 3.1:fas fa-table:014#Kegiatan Pelayanan Rawat Inap (RL 3.1)', 'Laporan Kegiatan Pelayanan Rawat Inap (RL 3.1)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Jenis Pelayanan:1, Pasien Awal Tahun:1, Pasien Masuk:1,Pasien Keluar Hidup:1,Pasien Keluar Mati:2,Jumlah Lama Dirawat:1,Pasien Akhir Tahun:1,Jumlah Hari Perawatan:1,Rincian Hari Perawatan Per Kelas:6', NULL, ':400,:150,:150,:150,< 48 Jam:150,>= 48 Jam:150,:150,:150,:150,VVIP:150,VIP:150,I:150,II:150,III:150,Kelas Khusus:200', 'pelayanan,awalTahun,masuk,keluarHidup,lt48,gt48,lamaDirawat,akhirTahun,hariRawat,vvip,vip,satu,dua,tiga,khusus', 'SELECT pelayanan.nama as pelayanan,0 as awalTahun,0 as masuk,0 as keluarHidup,0 as lt48,0 as gt48,0 as lamaDirawat,0 as akhirTahun,0 as hariRawat,0 as vvip,0 as vip,0 as satu,0 as dua,0 as tiga,0 as khusus from (\nselect	\'Penyakit Dalam\'	as nama	union all\nselect	\'Kesehatan Anak\' as nama	union all\nselect	\'Obstetri\'	as nama	union all\nselect	\'Ginekologi\'	as nama	union all\nselect	\'Bedah\'	as nama	union all\nselect	\'Bedah Orthopedi\'	as nama	union all\nselect	\'Bedah Saraf\'	as nama	union all\nselect	\'Luka Bakar\'	as nama	union all\nselect	\'S a r a f\'	as nama	union all\nselect	\'J i w a\'	as nama	union all\nselect	\'Psikologi\'	as nama	union all\nselect	\'Penatalaksana Pnyguna. NAPZA\'	as nama	union all\nselect	\'THT\'	as nama	union all\nselect	\'M a t a\'	as nama	union all\nselect	\'Kulit & Kelamin\'	as nama	union all\nselect	\'Kardiologi\'	as nama	union all\nselect	\'Paru-paru\'	as nama	union all\nselect	\'Geriatri\'	as nama	union all\nselect	\'Radioterapi\'	as nama	union all\nselect	\'Kedokteran Nuklir\'	as nama	union all\nselect	\'K u s t a\'	as nama	union all\nselect	\'Rehabilitasi Medik\'	as nama	union all\nselect	\'Isolasi\'	as nama	union all\nselect	\'I C U\'	as nama	union all\nselect	\'I C C U\'	as nama	union all\nselect	\'NICU / PICU\'	as nama	union all\nselect	\'Umum\'	as nama	union all\nselect	\'Gigi & Mulut\'	as nama	union all\nselect	\'Pelayanan Rawat Darurat\'	as nama	union all\nselect	\'Perinatologi\'	as nama\n\n) as pelayanan'),
(36, 'RL 3.10:fas fa-table:015#Kegiatan Pelayanan Khusus (RL 3.10)', 'Laporan Kegiatan Pelayanan Khusus (RL 3.10)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jenis Kegiatan:400, Jumlah:200', 'kegiatan, jumlah', 'select nameList.nama as kegiatan, 0 as jumlah from (\nselect	\'Electro Encephalographi ( EEG )\'	as nama	union all\nselect	\'Electro Kardiographi ( EKG )\'	as nama	union all\nselect	\'Electro Myographi ( EMG )\'	as nama	union all\nselect	\'Echo Cardiographi ( ECG )\'	as nama	union all\nselect	\'Endoskopi ( semua bentuk )\'	as nama	union all\nselect	\'Hemodialisa\'	as nama	union all\nselect	\'Densometri Tulang\'	as nama	union all\nselect	\'Bedah\'	as nama	union all\nselect	\'Pungsi\'	as nama	union all\nselect	\'Spirometri\'	as nama	union all\nselect	\'Tes kulit / Allergi / Histamin\'	as nama	union all\nselect	\'Topometri\'	as nama	union all\nselect	\'Tredmill / Exercise Test\'	as nama	union all\nselect	\'Akupuntur\'	as nama	union all\nselect	\'Hiperbarik\'	as nama	union all\nselect	\'Herbal/ Jamu\'	as nama	union all\nselect	\'Lain-lain\'	as nama\n) as nameList'),
(37, 'RL 3.11:fas fa-table:016#Kegiatan Kesehatan Jiwa (RL 3.11)', 'Laporan Kegiatan Kesehatan Jiwa (RL 3.11)', NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jenis Kegiatan:400, Jumlah:200', 'kegiatan, jumlah', 'SELECT nameList.nama as kegiatan, 0 as jumlah from (\nselect	\'Psikotes\'	as nama	union all\nselect	\'Konsultasi\'	as nama	union all\nselect	\'Terapi Medikamentosa\'	as nama	union all\nselect	\'Elektro Medik\'	as nama	union all\nselect	\'Psikoterapi\'	as nama	union all\nselect	\'Play Therapy\'	as nama	union all\nselect	\'Rehabilitasi Medik Psikiatrik\'	as nama\n) nameList'),
(38, 'RL 3.15:fas fa-table:017#Cara Bayar (RL 3.15)', 'Laporan Cara Bayar (RL 3.15)', NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 'NO:1,Cara Pembayaran:1,Pasien Rawat Inap:2,Jumlah Pasien Rawat Jalan:1,Jumlah Pasien Rawat Jalan:3', NULL, ':80:center, :400, Jumlah Pasien Keluar:150, Jumlah Lama Dirawat:150,:200,Laboratorium:150,Radiologi:150,Lain-Lain:150', 'no, cara,pasienKeluar,lamaDirawat,jumlahRawatJalan,lab,radiologi,lain2', 'select nameList.no, nameList.nama as cara, 0 as pasienKeluar, 0 as lamaDirawat, 0 as jumlahRawatJalan, 0 as lab, 0 as radiologi, 0 as lain2 from (\nselect	\'1\' as no, \'Membayar :\'	as nama	union all\nselect	\'1.1\' as no, \'Penuh\'	as nama	union all\nselect	\'1.2\' as no, \'Keringanan\'	as nama	union all\nselect	\'2\' as no, \'Asuransi :\'	as nama	union all\nselect	\'2.1\' as no, \'Asuransi Pemerintah/BPJS\'	as nama	union all\nselect	\'2.2\' as no, \'Asuransi Swasta\'	as nama	union all\nselect	\'2.3\' as no, \'Jamkesmas/Jamkesda / PBI\'	as nama	union all\nselect	\'2.4\' as no, \'Kontrak\'	as nama	union all\nselect	\'3\' as no, \'Gratis :\'	as nama	union all\nselect	\'3.1\' as no, \'Kartu Sehat\'	as nama	union all\nselect	\'3.2\' as no, \'Keterangan Tidak Mampu\'	as nama	union all\nselect	\'3.3\' as no, \'Lain-Lain\'	as nama\n) nameList'),
(39, 'RL 5.3:fas fa-table:018#Daftar 10 Besar Penyakit Rawat Inap (RL 5.3)', 'Laporan Daftar 10 Besar Penyakit Rawat Inap (RL 5.3)', NULL, 1, 1, NULL, NULL, 1, NULL, NULL, NULL, 'Kode ICD 10:1, Deskripsi:1,Pasien Keluar Hidup Menurut Jenis Kelamin:2, Pasien Keluar Mati Menurut Jenis Kelamin:2, Total(Hidup & Mati):1', NULL, ':150, :300,LK:150,PR:150,LK:150,PR:150,:200', 'kd_penyakit, nm_penyakit,hidupL,hidupP,matiL,matiP,jumlah', 'SELECT penyakit.kd_penyakit, penyakit.nm_penyakit, 0 as hidupL, 0 as hidupP, 0 as matiL, 0 as matiP, COUNT(diagnosa_pasien.no_rawat) as jumlah FROM penyakit\nleft join diagnosa_pasien on penyakit.kd_penyakit=diagnosa_pasien.kd_penyakit\nleft join reg_periksa on diagnosa_pasien.no_rawat=reg_periksa.no_rawat\nleft join kamar_inap on diagnosa_pasien.no_rawat=kamar_inap.no_rawat\nleft join kamar on kamar_inap.kd_kamar=kamar.kd_kamar\nwhere diagnosa_pasien.status = \'Ranap\' and\nkamar.kd_bangsal = \'#RUANG#\' and\nYEAR(reg_periksa.tgl_registrasi) = #TAHUN# and\nMONTH(reg_periksa.tgl_registrasi) = #BULAN#\ngroup by penyakit.nm_penyakit');
